import ProductView from "./Components/Featurs/ProductView/ProductView";
import { Footer } from "antd/es/layout/layout";

function App() {
  return (
    <div id="App">
      <Header />
      {/* <ProductView/> */}
      <LandingPage />
      <Footer/>
    </div>
  );
}

export default App;
